import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => (
  <header className="bg-gray-800 text-white p-4">
    <div className="container mx-auto flex justify-between items-center">
      <h1 className="text-3xl">Iuliia</h1>
      <nav>
      <Link to="/project1" className="mr-4 hover:text-gray-400">About</Link>
          <Link to="/project1" className="mr-4 hover:text-gray-400">Project 1</Link>
          <Link to="/project2" className="mr-4 hover:text-gray-400">Project 2</Link>
          <Link to="/contact" className="mr-4 hover:text-gray-400">Contact</Link>
      </nav>
    </div>
  </header>
);

export default Header;
